import React from 'react';
import {
  Box,
  Flex,
  Center,
  useColorModeValue,
  Spacer,
  Button,
  Image,
} from '@chakra-ui/react';

import { ColorModeSwitcher } from '../App.js';
import Logo from '../logo.svg';

import Hamburger from './Hamburger';

const Navbar = props => {
  const bg = useColorModeValue('blue.600', 'yellow.200');
  return (
    <Flex px="20" py="10" w="100%" {...props}>
      <Box>
        <Image sec={Logo} />
      </Box>
      <Spacer />
      <Center>
        <Button
          fontSize="xl"
          fontWeight="700"
          mr={10}
          // colorScheme={bg}
          variant="ghost"
          borderWidth="2px"
          borderColor={bg}
          size="md"
        >
          Resume
        </Button>
        <ColorModeSwitcher mr={10} />
        <Hamburger />
      </Center>
    </Flex>
  );
};

export default Navbar;
